jQuery(document).ready(function( $ ){
	
	$('#select-top-webinars').select2({ allowClear: true,
    placeholder: "Select Topic",});
	
	function filterWebinars(params,load_more = false){
		$.ajax({
			url: "/wp-admin/admin-ajax.php",
			data: {
			action: 'getWebinars',
			params: params,
			},
			type: 'post',
			dataType: 'json',
			success: (data) => {
				$('#post-loader').remove();
				if(load_more){
					$('.webinar-archive-list').append(data['response']);
				}
				else{
					$('.webinar-archive-list').html(data['response']);
				}
				console.log(data);
				if(data['current_page'] != data['total_pages']){
					$('.webinars-load-more-container').show();   
					$('.webinar-list-load-more').attr("data-current_page",data['current_page']);
					$('.webinar-list-load-more').attr("data-total_pages",data['total_pages'])
					if(data['total_pages'] == 0){
							$('.webinars-load-more-container').hide();
							if(data['response'].length == 0){
								var no_result='<div class="no-result-wrapper"><img src="/wp-content/uploads/2024/02/no-results-redesign.svg"/><div>No cases for the combination of filters you selected.<br><span>Please choose some other filter combination</span></div></div>';
								$('.webinar-archive-list').html(no_result);	
							}
						}
				}
				else{
					$('.webinars-load-more-container').hide();
					if(data['response']==""){
							
							var no_result='<div class="no-result-wrapper"><img src="/wp-content/uploads/2024/02/no-results-redesign.svg"/><div>No cases for the combination of filters you selected.<br><span>Please choose some other filter combination</span></div></div>';
							$('.webinar-archive-list').html(data['response']);
						}
				}
			},
		});
	}
	
	$(document).on("click",".webinar-list-load-more",function(e){
		var current_page = $(this).attr('data-current_page');
		var total_pages = $(this).attr('data-total_pages');
		var category = $('#select-top-webinars').val();
		let params = {
			type:$(".filter-type.active").attr("data-slug"),
			current_page: parseInt(current_page) + 1
		};	
		if(category != ""){
			params = {
				type:$(".filter-type.active").attr("data-slug"),
				current_page: 1,
				category: category
			}	
		}
		
		filterWebinars(params,true);
	});
	
    $(document).on("click",".filter-type",function(e){
		e.preventDefault();
		$('.webinar-archive-list').html("");
		$('.webinar-archive-list').prepend('<div id="webinars-loader"><img src="/wp-content/uploads/2022/10/loader-transparent.gif"/></div>')
		$(".filter-type").removeClass('active');
		$(this).addClass('active');
		var category = $('#select-top-webinars').val();
		
		

		let params = {
			type:$(".filter-type.active").attr("data-slug"),
			current_page: 1
		};	
		if(category != ""){
			params = {
				type:$(".filter-type.active").attr("data-slug"),
				current_page: 1,
				category: category
			}	
		}

		filterWebinars(params);
		
		
	})
	
	$(document).on("change","#select-top-webinars",function(e){
		e.preventDefault();
		$('.webinar-archive-list').html("");
		$('.webinar-archive-list').prepend('<div id="webinars-loader"><img src="/wp-content/uploads/2022/10/loader-transparent.gif"/></div>')
		
		var category = $('#select-top-webinars').val();

		
		
		let params = {
			type:$(".filter-type.active").attr("data-slug"),
			current_page: 1
		};	
		if(category != ""){
			params = {
				type:$(".filter-type.active").attr("data-slug"),
				current_page: 1,
				category: category
			}	
		}
		filterWebinars(params);
		
	});
	
});;
