jQuery(document).ready(function( $ ){
	$( ".subscribe-form-wrapper a.elementor-button" ).click(function() {
		var email = $(this).parents(".subscribe-form-wrapper").find("#form-field-subscribe_email").val();
  		//var email = $('#form-field-subscribe_email').val();
		if(email != ""){
			if(validateEmail(email)){
				subscribe(email, $(this));	
			}
			else{
				prependMsg("<p class='subscribe-error-text subscribe-text'>Invalid email address.</p>", $(this));
			}		
		}
		else{
			prependMsg("<p class='subscribe-error-text subscribe-text'>Invalid email address.</p>", $(this));
		}
				
	});
    function subscribe(email, currentSelector){
		var formData = {"Email" : email};
		
		$.ajax({
			url : "https://api.moosend.com/v3/subscribers/022fb860-6aa4-4c35-a77c-5cf2bcca98fc/subscribe.json?apikey=b4872eff-7a02-40e8-860f-88fb77bd0d5e",
			type: "POST",
			contentType : "application/json",
			data: JSON.stringify(formData),
			dataType: 'json',
			
			success: function(res, textStatus, xhr)
			{
				if(xhr.status == 200){
					if(res["Code"] == 0){
						$('#form-field-subscribe_email').val("");
						prependMsg("<p class='subscribe-success-text subscribe-text'>You subscribed in our email list successfully.</p>", currentSelector);
					}
					else{
						prependMsg("<p class='subscribe-error-text subscribe-text'>Something went wrong. Please try again or contact the administrator.</p>", currentSelector);
					}
					
					
					console.log(res);
					//var data = JSON.parse(res);
					console.log(res["Code"]);		
				}
				
			},
			error: function (jqXHR, textStatus, errorThrown)
			{
				alert('ERROR');
			}
		});
	}
	function validateEmail(email){
		return email.toLowerCase().match(
      /^(([^<>()[\]\\.,;:\s@"]+(\.[^<>()[\]\\.,;:\s@"]+)*)|(".+"))@((\[[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\])|(([a-zA-Z\-0-9]+\.)+[a-zA-Z]{2,}))$/
    	);
	}
	function prependMsg(msg, currentSelector){
		currentSelector.parents(".subscribe-form-wrapper").next('.subscribe-terms-text').prepend(msg);
		//$('.subscribe-terms-text').prepend(msg)
		setTimeout(function() {$(".subscribe-text").remove();}, 7000);
	}
	
});;
